  function toggleChecked(){
    setState(true);
  };

  function toggleDisable(){
    setState(false);
  };

  function onChange(){
    setState(!state)
  };

  return (
    <>
        <p>
          <Button
            style={{ margin: '0 10px' }}
            type="primary"
            size="small"
            onClick={toggleDisable()}
          >
            {!setState(true) ? toggleDisable() : toggleChecked()}
          </Button>
        </p>
    </>
  );
}
export default Lock;
